Objetivo (c).492:
Fica alterada a Cl. 16ª, conforme protocolo n.º 10081/2016, que passará a vigorá com a seguinte redação:
“CLÁUSULA DÉCIMA SEXTA – DO REAJUSTE E DA REPACTUAÇÃO
16.1. Do reajuste para insumos e materiais (reajustamento de preços efetuado pela aplicação de índices de preços oficiais gerais, específicos, setoriais):
16.1.1. O valor proposto e contratado poderá ser reajustado a cada período de 12 (doze) meses, contados da data do início da vigência deste instrumento, conforme a variação do IGP-DI da Fundação Getúlio Vargas, mediante requerimento da empresa protocolizado à época de completar-se cada período, sob pena de preclusão;
I.	A data base para o cálculo do primeiro período será a data de aniversário da proposta;
II.	A data base para os demais e sucessivos períodos será a data de concessão do último reajuste. 

16.2. Da repactuação para mão-de-obra, encargos e provisões respectivas (reajustamento de preços que visa adequar o valor original do contrato, baseado em planilha analítica de custos, aos novos preços de mercado, observada a variação efetiva dos custos de execução do objeto):
16.1.1. O valor proposto e contratado poderá ser repactuado a cada período de 12 (doze) meses, contados da data do início da vigência deste instrumento, mediante requerimento da empresa protocolizado à época de completar-se cada período, sob pena de preclusão;

16.2.2. O requerimento da contratada deverá ser acompanhado de:
I.	Documentos indispensáveis à comprovação da alteração dos preços de mercado de cada um dos itens da planilha a serem alterados, quando for o caso;
II.	Novo acordo ou convenção coletiva de trabalho, sentença normativa ou lei, que fundamentam o pedido de repactuação;
III.	Demonstração da alteração dos custos, por meio de apresentação das planilhas analíticas de composição de custos e formação de preços; e
IV.	Documentos que comprovem que a contratada já arca com os custos decorrentes das disposições do novo acordo ou convenção coletiva.

16.2.3. Serão concedidos os direitos decorrentes da repactuação, a partir de sua solicitação, sem retroatividade.”
